import time

start = time.clock()


class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        num = 0
        for i in range(len(s)):
            tmp = []
            for j in range(i, len(s)):
                if s[j] not in tmp:
                    tmp.append(s[j])
                else:
                    break
            if num < len(tmp):
                num = len(tmp)
        return num

    def method2(self, s):
        start = 0
        maxlen = 0
        hashtable = [-1 for i in range(256)]
        for i in range(len(s)):
            if hashtable[ord(s[i])] != -1:
                while start <= hashtable[ord(s[i])]:
                    hashtable[ord(s[start])] = -1
                    start += 1
            maxlen = max(i - start + 1, maxlen)
            hashtable[ord(s[i])] = i
        return maxlen

    def method3(self, s):
        p, q, d = 0, 0, {}
        n, m = len(s), 0
        while p<n and q < n:
            if s[q] not in d:
                d[s[q]] = q
                m = max(m, q - p + 1)
            else:
                m = max(m, q-p)
                p = d[s[q]]+1
                d = {s[_]:_ for _ in range(p, q+1)}
            q += 1
        return m

